import React from 'react';
import Slider from 'react-slick';
import { useAppSelector } from '../../store/storeHooks';

let trendingSettings = {
    infinite: false,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    arrows: false,
};

const TrendingSlider = () => {

    const trendingSliderData = useAppSelector(state => state.homeData.homeData);
    console.log("trendingSliderData==>", trendingSliderData)

    return (
        <>
            <section className="trending-services">
                <div className="container">
                    <Slider {...trendingSettings}>
                        <h1>Trending Features</h1>
                        {
                            trendingSliderData ? trendingSliderData.subcategoryData.map((trendingData, index) => {
                                return (
                                    <h1>Trending Data</h1>
                                )
                            }) : null
                        }
                    </Slider>

                    {/* <button type="button" data-role="none"
                        className="slick-arrow slick-prev slick-disabled" style={{ display: "block" }}>
                        Previous
                    </button>

                    <button type="button" data-role="none" className="slick-arrow slick-next" style={{ display: "block" }}>
                        Next</button> */}

                </div>
            </section>
        </>
    )
}

export default TrendingSlider
